window.bookSummaryJSON = "<p>Eccentric psychic medium Celeste Fox has enjoyed a decades-long career in the public eye, coaching people through exciting and challenging times with her unique spiritual insight. Her reputation takes a significant blow after a recent public appearance results in a tragic death. To defend herself against wild accusations and sensational media coverage, Celeste books a recording studio in Manhattan where she aims to take control of her own narrative by recording an episode of a new podcast. As the episode progresses, Celeste divulges details from her past and weaves an intricate tale from which she has difficulty untangling herself, even as the stakes of her confession mount.&nbsp;</p> <p>Playwright Aaron Mark was awarded a commission through the Audible Emerging Playwrights Fund, an initiative dedicated to developing innovative original plays driven by language and voice. As an Audible commissioned playwright, he received funding and creative support to develop<i> Vanishing Negative</i>.</p> <p><i>Portions of this audiobook contain mature language and themes. Listener discretion is advised.</i></p> <p>Experience this title in immersive 3D audio by <a href=\"https://help.audible.com/s/article/how-can-i-change-the-download-format-settings-in-the-audible-for-android-and-audible-for-ios-apps/\">setting your download quality to High</a> within the app. Headphones recommended. For more, browse our <a href=\"https://www.audible.com/ep/3d-audio\">entire collection of 3D audio listens</a>.&nbsp;</p>"; 
